import { Provider } from "react-redux";
import { createStore, combineReducers } from "redux";

const initialState = {
  userData: [],
};

const ADD_GEN = "ADD_GEN";

export const setGeneration = (data) => ({ type: ADD_GEN, data });

const store = createStore(reducer);

function reducer(state = initialState, action) {
  switch (action.type) {
    case "login":
      return state;
    default:
      return state;
  }
}

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Provider store={store}>
        <App />
      </Provider>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);

